Is a key driver for adaptations but often produces undesired outcomes further down the track due to its mismanagement and loading at the start 😬

A common prescription of 3x12 at the start of a training cycle for a beginner is all fine and dandy, but the question is, now what? 🤔

Do we progress with more sets/reps (VOL) or more weight (INT)? 🤔 

The answer is neither because you've just gone 0-100 without building phase and now that 💯 becomes an incorrect baseline of which everything else will then be progressed from ⚰️

A common loading scheme that I program at @deltasc_ would typically see the first week opening at 3x8 followed by 3x10 then onto 4x8 and finally at 3x12 ✅

There is nothing special being done here, it's just managing the volume to ensure progress and adequate recovery without over reaching ✅

Whenever you see a 3x12, ask yourself or your coach - did I have a prior building phase to get me here? 🤔

