Did you know that the “Beautiful Helen” was born on the islet “Pefnos”, located in the port of Agios Dimitrios of West Mani?
In antiquity this was Pefnos.

Yes - that is also the same Helen of Troy or Helen of Sparta!!!

The Egg statue created by @giannis_atzg represents Zeus who transformed into a swan and mated with Leda. From this union an egg emerged, through which the “Beautiful Helen” and the Dioscuri were born.

Recently on Saturday 22 August 2020, the project's lead professor Petros Themelis and the Minister of Culture and Sports Lina Mendoni, inaugurated the statue (the egg from which Helena, Castor and Pollux was born), in the harbour of Agios Dimitrios - West Mani, Messinia. The statue is designed by sculptor and artist Giannis Gkouzos. 

This is a video on the egg statue's placement...
https://youtu.be/7fYLr6Nqa14

Beautiful Helen, beautiful Mani - this is where we are from and call home...

