.
Constantly being uncomfortable will also exhaust us, so hopefully we find some balance. But when we think ‘nah, I ain’t going for a run in the rain, I’m all snuggly’, perhaps that’s when we just need to throw on shorts and running short and head out regardless, no specific plan or direction, JUST GO!!
.
That’s what last night was ... I really couldn’t be fucked. And as I stripped off for bed, without any forethought, I just threw on shorts and a wool top, grabbed a buff and headed out the door, log in hand. 
.
2 miles later I was feeling invigorated and back into my ‘uncomfortable’ zone. The only plan ... log doesn’t hit the deck, and I get through some podcasts. Comfort is returning to a hot then cold shower and gorgeous candlelight. 
.
It was wet, cool, dark and FUCKING AWESOME. When was the last time you grew!
#comfortablebeinguncomfortable #logrunning #wetanddarkoutside #fuckcomfortzone 
